    return (
        <>
            <h3>{ category }</h3>

            <div className="card-grid">

                    { data.map ( ( img ) => (
                        <GifGridItem 
                            key={img.id}
                            { ...img }
                        />
                    ))}

            </div>
        </>
    )
}
